  CONSTRAINT `komisija_ibfk1` FOREIGN KEY (`username`) REFERENCES `nastavnik` (`username`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `komisija_ibfk2` FOREIGN KEY (`username1`) REFERENCES `nastavnik` (`username`),
